import React from 'react';
import { Button, Text } from '@geist-ui/react';
import { NavBar } from './Navbar.Styled';

function Navbar() {
  return (
    <NavBar>
      <div className='logo'>
        <h4>Logo</h4>
      </div>
      <div className='navbar-items'>
        <h3>Don't have an account?</h3>
        <Button size='small'>Sign up</Button>
      </div>
    </NavBar>
  );
}

export default Navbar;
